import React from 'react'
import { connect } from 'react-redux';


const GithubUsers = () => {
    return (
        <div>
            <ul>
                {this.props.users.map(user => 
                    <li>{user.id}</li>
                )}
            </ul>
        </div>
    )
}

const mapStateToProps = state => {
    return { users: state.addUser }
}

export default connect(mapStateToProps)(GithubUsers);
